ndow._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1150298","type":"CustomJS"},{"attributes":{"fill_color":"#ffffea","line_color":"#ffcb66","x":{"field":"index"},"y":{"field":"equity_dd"}},"id":"1149989","type":"Patch"},{"attributes":{},"id":"1149964","type":"BasicTicker"},{"attributes":{"dimensions":"width"},"id":"1149931","type":"PanTool"},{"attributes":{},"id":"1150021","type":"UnionRenderers"},{"attributes":{},"id":"1149977","type":"SaveTool"},{"attributes":{},"id":"1150107","type":"LinearScale"},{"attributes":{"axis":{"id":"1150113"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1150116","type":"Grid"},{"attributes":{"label":{"value":"Max Dd Dur. (1118 days)"},"renderers":[{"id":"1150078"}]},"id":"1150100","type":"LegendItem"},{"attributes":{"data":{"datetime":{"__ndarray__":"AAAA7v83dkIAAMBTUjh
